[
    {
        "reviewer_name": "Freddy Ard",
        "review_text": "For quite some time I have wanted to purchase the Casio G-Shock DW5600, but when I considered the additional features of the Casio G-Shock GWM5610, I decided to spend twice the $.  My only other G-Shock experience (excellent) is with a DW6900, which I have owned about 5 years, considered my beater or tough duty/activity watch.  The handy instruction booklet got me reasonably familiar with the functions and settings sequences, although I might have to refer again on certain matters.  Accordingly, set up to my preferences was quick, simple, and in short order I began the enjoyment of this digital watch.The black resin band is secured comfortably and easily by a traditional polished silver buckle and tongue.  Although describe in larger metrics, I would say the face appears much along the lines of 40mm on my 6-7/8\" wrist.  It is relatively lightweight, and generally comfortable to wear.  The excellent backlight far outperforms that of any I have seen on the Casio products.  All the functions perform outstandingly.  The solar-power and atomic timekeeping are really cool features, and frankly, seem to account for increase in price over the DW5600.  Since I have only had mine a few days, I can't yet attest to the durability, but have no doubts that it is rugged and can stand up to anything I will give it.  I dig the appearance and the display, and might say my expectations are exceeded.Now, for the more \"classic\" piece, I guess I will have to order me a companion DW5600 to alternate with my GWM5610.",
        "review_rating": "5.0 out of 5 stars",
        "review_date": "Reviewed in the United States on April 5, 2024"
    },
    {
        "reviewer_name": "D.B.",
        "review_text": "This is perhaps as close to a perfect digital watch as you can get.  Besides the toughness of a G=Shock, it's got all the daily features one may need (alarm - which you can set up to 5, stopwatch and countdown timer).  It also has world time, which is a nice feature to have when travelling.  When in stop watch and time modes, the current time is displayed in the upper right corner of the display where the date normally is.  It's solar powered, and the display shows how much power the watch has.  Multi-band 6 is another feature, so it automatically sets the time once it receives a signal from an atomic clock transmitter.  YMMV with this feature though.  I have difficulty receiving the signal being on the U.S. east coast (the transmitter is in Colorado).  There are phone apps you can use to strengthen the signal if normal reception fails.  Despite this, it can be manually set if needed.Visibility of the display is an upgrade over the DW-5600.  It's more clear, and more visible at different viewing angles.  The standard backlight is now LED instead of the classic electroluminescence.  Some prefer the latter.  This may or may not be a deal breaker based on personal preference, but considering what this watch has to offer, it should only be a consideration in the bigger picture.The watch offers a great fit for G-Shock.  With its slim profile, it lacks the bulk of many of the other G-Shock models out there.  It's very comfortable to wear on different size wrists, though the strap may not be everyone's cup of tea.The design is very much retro, harkening back to the 1983 original square with the red border.For the price of this watch, it really is a great value.  It's also possibly the only digital watch you'll ever need unless you want other functions like tides, barometers, etc.  In my collection, this watch is one of my favorites. There's a good chance it will become one of yours too.",
        "review_rating": "5.0 out of 5 stars",
        "review_date": "Reviewed in the United States on February 18, 2024"
    },
    {
        "reviewer_name": "Dennis F. Cwik",
        "review_text": "For the past 10 years, I've thought that mechanical watches had so much charm and passion, while quartz watches were soulless devices. I picked up this watch to be a \"beater\" when my automatic watches weren't suitable, but I've actually grown quite fond of the GW-M5610. What's not to love about a light, small, tough-as-nails, super accurate, solar watch?I got this watch from Amazon on April 5, 2019 (in the USA). First thing I noticed was that it did not come in the hexagonal tin box that a lot of older online reviews show, but a flimsy cardboard box with a simple display holder. At first I was annoyed, but honestly the box would have just been tucked away in storage with other watch boxes that never see any use.After unboxing, you'll find a warranty card, a handful of manuals in various languages, and the watch in a simple plastic bag (no protective stickers on the crystal or caseback, no fancy hangtags). I immediately checked out when the last sync time was (bottom right button), which happened to be on November 1. Assuming this sync happened before it was packaged up, that meant it was sitting for 5 months in the dark, but it still showed high power (as indicated at the bottom of the display, where there's a L, M, H meter). Yay for power saving mode!Next step was to set the timezone. The manual states that the default timezone after losing all power is Tokyo. I assumed this was what the watch would be shipped with, but mine was set to NYC by default. I'm curious if watches sent to the USA are set this way, or if someone played around with this watch. After selecting my local timezone (Pacific), it was only 2 seconds slow! I know quartz watches are accurate but that is phenomenal, especially considering the manual states +/- 15 seconds per month without a signal calibration.Speaking of signal calibration, I've had my watch automatically sync about every other night in Seattle. I have an old Casio Waveceptor (10 years old) that never syncs anymore. I don't know if that's because it has become defective, or the GW-M5610 can pick up a weaker signal strength. Regardless, there's no need to worry about missing a few nights in a row of syncing, as it'll still be very accurate.The caseback on mine was machined and not stamped, with crisp engraving (FYI, I removed the serial number from the image, normally found on the bottom of the caseback). As far as I know, only older models will have the stamped, rounded version. While on the wrist, it feels just as comfortable as any rounded caseback I've had.I really like that the resin strap is already pre-rounded/pre-shaped. I've had tough, flat rubber/plastic/resin straps on other watches that were incredibly uncomfortable (I'm looking at you, SKX009). On my 6.25\" wrist, the watch strap keeper is right at the end, and there's maybe 1/4\" excess strap sticking out. If your wrist is smaller, you'll unfortunately have more strap sticking out, which will probably be a bit annoying.Other reviews state that the A-EL feature didn't work on their watches, which is the auto-illumination when you tilt your wrist up. Mine works flawlessly. I'm curious if this was an issue with earlier models that has since been addressed.The only minor annoyance I can find with this watch is the non-standard lug width/strap. I think the stock strap fits it perfectly (both in terms of comfort and aesthetics) and have no desire to change it, but it's proprietary. That being said, I'm sure it won't be hard to find a replacement strap if needed.The GW-M5610 has a perfect blend of retro styling, useful functions, durability, comfort, and laziness (it sets itself!).",
        "review_rating": "5.0 out of 5 stars",
        "review_date": "Reviewed in the United States on April 11, 2019"
    }
]
